int qspToWUpper(int c)
{
    if (c < 0x80)
    {
        if (c >= 'a' && c <= 'z') return c - 0x20;
        return c;
    }

    if (c < 0x10000)
    {
        unsigned short pageIndex = qspToWUpperTop[c >> 8];
        if (pageIndex == 0xFFFF) return c;
        return qspToWUpperPages[(pageIndex << 8) | (c & 0xFF)];
    }

    return c;
}
